import React, { useState } from "react";

import { FaUserCheck } from "react-icons/fa";

function Login() {
  const [formData, setFormData] = useState({
    email: "",
    parola: "",
  });

  const {  email, parola, parolaKontrol } = formData;

  const onChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      [e.target.name]: e.target.value,
    }));
  };

  const onSubmit = (e) => {
    e.preventDefault();
    console.log(formData);
  };

  return (
    <>
      <section className="heading">
        <h1>
          <FaUserCheck /> Login
        </h1>
      </section>
      <section className="form">
        <form onSubmit={onSubmit}>
          <div className="form-group">
            <input
              type="text"
              classname="form-control"
              id="kullaniciAd"
              name="kullaniciAd"
              value={kullaniciAd}
              placeholder="user name"
              onChange={onChange}></input>
          </div>
          <div className="form-group">
            <input
              type="email"
              classname="form-control"
              id="email"
              name="email"
              value={email}
              placeholder="email"
              onChange={onChange}></input>
          </div>
          <div className="form-group">
            <input
              type="password"
              classname="form-control"
              id="parola"
              name="parola"
              value={parola}
              placeholder="password"
              onChange={onChange}></input>
          </div>
          <div className="form-group">
            <input
              type="password"
              classname="form-control"
              id="parolaKontrol"
              name="parolaKontrol"
              value={parolaKontrol}
              placeholder="verify password"
              onChange={onChange}></input>
          </div>
          <div className="form-group">
            <button type="submit" className="btn btn-block">
              Register
            </button>
          </div>
        </form>
      </section>
    </>
  );
}

export default Login;
